import React, { useEffect, useState } from 'react'

export default function () {
    const [data,setdata]=useState(NaN);
    const call= async()=>{
        let data= await fetch('http://localhost:4000/api/posts');
        let datan= await data.json();
        setdata(data.data);
        console.log(datan);
    };

    useEffect(()=>{
        call();
    },[])

     return (
        <div>
            {
                data.map((element)=>{
                    return (<h1>{element.title}</h1>);
                })
            }
        </div>
        )
}
